"use strict";(self.webpackChunkdigital_garden=self.webpackChunkdigital_garden||[]).push([[88628],{55889:e=>{e.exports=JSON.parse('{"label":"productivity","permalink":"/docs/tags/productivity","allTagsPath":"/docs/tags","count":16,"items":[{"id":"Books/Book Reviews/Four Thousand Weeks Time Management for Mortals","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book takes all the productivity books and self-help books and asks if we should take a step back and not be captives of our own ambitions. This book is for those who try too hard to be 10X\'ers and feel demotivated by their lack of results.","permalink":"/docs/Books/Book Reviews/Four Thousand Weeks Time Management for Mortals"},{"id":"Books/Book Reviews/Take Control of Automating Your Mac","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is about cool and fast ways you can automate your Mac experience. It goes over the most important things you can automate, with a strong focus on Mac apps. It goes deeper into automation such as Keyboard Maestro","permalink":"/docs/Books/Book Reviews/Take Control of Automating Your Mac"},{"id":"Books/Book Reviews/Thinking in Systems","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is about understanding and conveying how the system works and how you can use systems thinking to understand the world differently. Systems have mechanisms that govern their behavior, and system thinking allows you to model how the system behaves when manipulating it.","permalink":"/docs/Books/Book Reviews/Thinking in Systems"},{"id":"Books/Book Reviews/Your Brain at Work","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is about how you can understand and work on your performance by understanding how the brain works. The book goes through different scenarios and explains why the persons in the scenario do what they do and what they can do to achieve better results.  The book contains helpful hints about how to \\"hack\\" your brain to achieve better results and improve your life.","permalink":"/docs/Books/Book Reviews/Your Brain at Work"},{"id":"Mac/Alfred","title":"Alfred","description":"Alfred is basically Spotlight on steroids. It contains all the features of Spotlight but is more powerful. If you purchase the powerpack, you also get access to workflows.","permalink":"/docs/Mac/Alfred"},{"id":"Iphone/Apps","title":"Apps","description":"Streaks","permalink":"/docs/Iphone/Apps"},{"id":"Books/Book Reviews/Hooked","title":"Hooked","description":"Tags: #books #non-fiction #development #psychology #apps","permalink":"/docs/Books/Book Reviews/Hooked"},{"id":"Mac/Karabiner","title":"Karabiner","description":"Karabiner is a powerful and customizable keyboard remapping tool designed specifically for macOS. It allows users to modify the behavior of their keyboards by remapping keys, creating shortcuts, and implementing various keyboard modifications. With Karabiner, users can redefine keys to perform different functions or assign complex combinations of keys to trigger specific actions. This enables users to personalize their keyboard layout and streamline their workflow, making it easier and more efficient to navigate through applications and perform tasks.","permalink":"/docs/Mac/Karabiner"},{"id":"Mac/Mac","title":"Mac","description":"I switched from Windows to Mac in 2021 and used it privately until 2022 when I switched to a Mac for work as well.","permalink":"/docs/Mac/"},{"id":"Obsidian/Obsidian","title":"Obsidian","description":"Obsidian is where I store my knowledge. I use it as a tool for writing, for storing information and knowledge, and for remembering. The main point of using obsidian is that it is living on your personal computer, can be treated as a good tool for writing quickly and also can be integrated with a lot of different tools, which probably is a huge advantage.","permalink":"/docs/Obsidian/"},{"id":"Productivity/Productivity Theory","title":"Productivity Theory","description":"Gilb\xb4s Law","permalink":"/docs/Productivity/Productivity Theory"},{"id":"Working/Remote Work","title":"Remote Work","description":"I did some remote working when I was at Bali, working primarily on my side projects. I felt like it is very difficult to motivate oneself if one does not have a social society or connection. It was fun however to experience new places.","permalink":"/docs/Working/Remote Work"},{"id":"Books/Book Reviews/Extreme Ownership","title":"The Book in 3 Sentences","description":"Leif and Jocko go through their combat experiences in combat and the lessons in leadership that they have learned from them. They break down concepts, explain why they are important for the SEALS, and highlight them in the business context as well.","permalink":"/docs/Books/Book Reviews/Extreme Ownership"},{"id":"Books/Book Reviews/Made to Stick","title":"The Book in 3 Sentences","description":"This book describes the underlying reasons why an idea sticks. It goes through the concreteness, unexpectedness, and credibility of an idea and how it affects how well an idea sticks. It goes through interesting cases and highlights reasons why these ideas have become ingrained in our collective minds.","permalink":"/docs/Books/Book Reviews/Made to Stick"},{"id":"Tools/Tools","title":"Tools","description":"Tools are the things I use to accomplish tasks. A tool can both be a requirement and a supplement to myself.","permalink":"/docs/Tools/"},{"id":"Working/Working","title":"Working","description":"I have currently worked in different types of work. From being a driver to being a moving-operator, to warehouse Employee,  and finally Data Scientist.","permalink":"/docs/Working/"}],"unlisted":false}')}}]);